import "../App.css";
import React from 'react';

const SearchBar = (props) => {
    return (
      <ul className="Line">
        <li onClick={() => navigator.clipboard.writeText(props.symbol)}>
          <p>{props.title}</p>
          <p>{props.symbol}</p>
        </li>
      </ul>
    );
  };


export default SearchBar;
